        async function checkPassword() {
            const input = document.getElementById('password').value;
            const msg = document.getElementById('error-msg');
            
            // ÂÖ•Âäõ„Åï„Çå„Åü„Éë„Çπ„ÉØ„Éº„Éâ„Çí„Éè„ÉÉ„Ç∑„É•Âåñ
            const encoder = new TextEncoder();
            const data = encoder.encode(input);
            const hashBuffer = await crypto.subtle.digest('SHA-256', data);
            const hashArray = Array.from(new Uint8Array(hashBuffer));
            const hashHex = hashArray.map(b => b.toString(16).padStart(2, '0')).join('');

            if (hashHex === correctHash) {
                // Ê≠£„Åó„ÅÑÂ†¥Âêà„ÄÅ„Ç≥„É≥„ÉÜ„É≥„ÉÑ„ÇíÂ±ïÈñã
                // document.open();
                // document.write(atob(encryptedContent));
                // document.close();
                
                // ÊñáÂ≠óÂåñ„ÅëÂØæÁ≠ñ: Blob„Çí‰ΩøÁî®„Åó„Å¶UTF-8„ÇíÊòéÁ§∫
                const binaryString = atob(encryptedContent);
                const bytes = new Uint8Array(binaryString.length);
                for (let i = 0; i < binaryString.length; i++) {
                    bytes[i] = binaryString.charCodeAt(i);
                }
                const blob = new Blob([bytes], { type: 'text/html; charset=utf-8' });
                const url = URL.createObjectURL(blob);

                const iframe = document.createElement('iframe');
                iframe.style.position = 'fixed';
                iframe.style.top = '0';
                iframe.style.left = '0';
                iframe.style.width = '100%';
                iframe.style.height = '100%';
                iframe.style.border = 'none';
                iframe.style.overflow = 'hidden';
                
                document.body.style.margin = '0';
                document.body.style.padding = '0';
                document.body.style.overflow = 'hidden';
                document.body.style.width = '100%';
                document.body.style.height = '100vh';
                
                document.body.innerHTML = '';
                document.body.appendChild(iframe);
                iframe.src = url;
                
            } else {
                msg.style.display = 'block';
            }
        }
        
        // Enter„Ç≠„ÉºÂØæÂøú
        document.getElementById('password').addEventListener('keypress', function (e) {
            if (e.key === 'Enter') {
                checkPassword();
            }
        });
    </script>
